import axios from "axios";
import { connect } from 'react-redux';

function API(props){
    return(
        <div>
        {
            axios.get('http://localhost:5000/api/product/get')
            .then((result)=> {
            props.productState([...result.data])
            }).catch(()=>{/*요청실패시 실행*/})
        }
        </div>
    )
}

function productState(state){
    return{
        state:state
    }
}

export default connect(productState)(API);
